message:
𝐒𝐀Ú𝐃𝐄 𝐍𝐀𝐓𝐔𝐑𝐀𝐋

A riqueza da água de coco!

Água de coco integral: é a parte líquida extraída do coco em seu estado natural, sem fermentação, diluição ou adição de substâncias.

Benefícios:

• Refresca e hidrata o corpo;
• A bebida é fonte de açúcares e minerais, sendo considerada um isotônico natural;
• Reposição hidroeletrolítica durante e após o exercício físico;
• Esse isotônico natural repõe os eletrólitos como potássio, magnésio e sódio, que são perdidos no suor do corpo;
• Ajuda a repor líquidos, sendo bastante indicada em casos de diarreia, vômito e desidratação;
• Evita cãibras;
• Contribui para a redução da pressão arterial:
• Trabalha em benefício dos rins;

